CREATE DEFINER=`root`@`localhost` PROCEDURE `sprint_velocity`()
BEGIN

select a.app_name as primary_category, js.sprint_name as secondary_category, js.start_date, 
js.end_date,jv.estimated as Commited, jv.completed as Completed
from application a, jira_sprint js, jira_velocity jv  where js.app_id = a.app_id  
and a.app_id = jv.app_id  and js.sprint_id = jv.sprint_id  
and js.id IN (select * from (
(select js.id from jira_sprint js, jira_velocity jv where js.app_id = SPLIT_STR(GET_APP_IDS(), ',', 1) and js.app_id = jv.app_id  
and js.sprint_id = jv.sprint_id  and js.rapidview_id = jv.rapidview_id  order by js.start_date DESC limit 3)
union all
(select js.id from jira_sprint js, jira_velocity jv where js.app_id = SPLIT_STR(GET_APP_IDS(), ',', 2) and js.app_id = jv.app_id  
and js.sprint_id = jv.sprint_id  and js.rapidview_id = jv.rapidview_id  order by js.start_date DESC limit 3)
union all
(select js.id from jira_sprint js, jira_velocity jv where js.app_id = SPLIT_STR(GET_APP_IDS(), ',', 3) and js.app_id = jv.app_id  
and js.sprint_id = jv.sprint_id  and js.rapidview_id = jv.rapidview_id  order by js.start_date DESC limit 3)
) Final) order by js.start_date DESC;
END ;;
