CREATE DEFINER=`root`@`localhost` PROCEDURE `user_stories_call`(IN app_id_var bigint(20),IN sprint_id_var bigint(20))
BEGIN

select count(distinct jus.userstory_id) as data, DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') as categories,  CASE jus.status_code  WHEN 10000 THEN 'New'  WHEN 3 THEN 'In Progress'  WHEN 1 THEN 'In Progress'  WHEN 6 THEN 'Closed'  WHEN 10003 THEN 'Closed'  END AS name from jira_userstory_status jus, jira_userstory ju, jira_sprint js  where jus.status_code IN (10000)  and jus.userstory_id = ju.id  and ju.sprint_id = js.sprint_id  and ju.app_id = js.app_id  and ju.rapidview_id = js.rapidview_id  and ju.sprint_id = sprint_id_var and ju.rapidview_id = (select rapidview_id from jira_sprint where sprint_id = ju.sprint_id and app_id =ju.app_id )  and ju.app_id = app_id_var and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') >= DATE_FORMAT(js.start_date,'%Y-%m-%d')  and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') <= DATE_FORMAT(js.end_date,'%Y-%m-%d')  group by categories  
union 
select count(distinct jus.userstory_id) as data, DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') as categories,  CASE jus.status_code  WHEN 10000 THEN 'New'  WHEN 3 THEN 'In Progress'  WHEN 1 THEN 'In Progress'  WHEN 6 THEN 'Closed'  WHEN 10003 THEN 'Closed'  END AS name from jira_userstory_status jus, jira_userstory ju, jira_sprint js  where jus.status_code IN (3,1)  and jus.userstory_id = ju.id  and ju.sprint_id = js.sprint_id  and ju.app_id = js.app_id  and ju.rapidview_id = js.rapidview_id  and ju.sprint_id = sprint_id_var and ju.rapidview_id = (select rapidview_id from jira_sprint where sprint_id = ju.sprint_id and app_id =ju.app_id ) and ju.app_id = app_id_var and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') >= DATE_FORMAT(js.start_date,'%Y-%m-%d')  and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') <= DATE_FORMAT(js.end_date,'%Y-%m-%d')  group by categories  
union
select count(distinct jus.userstory_id) as data, DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') as categories,  CASE jus.status_code  WHEN 10000 THEN 'New'  WHEN 3 THEN 'In Progress'  WHEN 1 THEN 'In Progress'  WHEN 6 THEN 'Closed'  WHEN 10003 THEN 'Closed'  END AS name from jira_userstory_status jus, jira_userstory ju, jira_sprint js  where jus.status_code IN (6,10003)  and jus.userstory_id = ju.id  and ju.sprint_id = js.sprint_id  and ju.app_id = js.app_id  and ju.rapidview_id = js.rapidview_id  and ju.sprint_id = sprint_id_var and ju.rapidview_id = (select rapidview_id from jira_sprint where sprint_id = ju.sprint_id and app_id =ju.app_id ) and ju.app_id = app_id_var and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') >= DATE_FORMAT(js.start_date,'%Y-%m-%d')  and DATE_FORMAT(jus.status_datetime,'%Y-%m-%d') <= DATE_FORMAT(js.end_date,'%Y-%m-%d')  group by categories order by categories;

